from sgrequests import SgRequests
from bs4 import BeautifulSoup
import csv
import re

def write_output(data):
	with open('data.csv', mode='w', encoding="utf-8") as output_file:
		writer = csv.writer(output_file, delimiter=',', quotechar='"', quoting=csv.QUOTE_ALL)

		# Header
		writer.writerow(["locator_domain", "page_url", "location_name", "street_address", "city", "state", "zip", "country_code", "store_number", "phone", "location_type", "latitude", "longitude", "hours_of_operation"])
		# Body
		for row in data:
			writer.writerow(row)

def fetch_data():
	
	base_link = 'https://www.hy-vee.com/stores/gas-station-finder-results.aspx?zip=&state=&city=&diesel=False&e85=False&24hour=False&atm=False&fuelcall=False'

	user_agent = 'Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/80.0.3987.162 Safari/537.36'
	HEADERS = {'User-Agent' : user_agent}

	session = SgRequests()
	req = session.get(base_link, headers = HEADERS)
	base = BeautifulSoup(req.text,"lxml")

	data = []
	payload = ""

	last_page = base.find(class_="paging").find_all("a")[-2].text

	locator_domain = "hy-vee.com"

	for page_num in range(1,int(last_page)+1):

		if page_num < 4:
			viewstate = ''
			viewstate1 = ''
			validation = ''

		elif page_num < 7:
			viewstate = ''
			viewstate1 = ''
			validation = ''

		elif page_num < 10:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 13:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 16:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 19:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 22:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 25:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		script_man = 'ctl00$cph_main_content$spuGasFinderResults$upPaging|ctl00$cph_main_content$spuGasFinderResults$gvStores$ctl10$Page%s' %page_num
		event = 'ctl00$cph_main_content$spuGasFinderResults$gvStores$ctl10$Page%s' %page_num

		# Request post
		payload = {'ctl00$ScriptManager1': script_man,
					'ctl00$cph_main_content$spuGasFinderResults$spuGasFinder$txtZip':'',
					'ctl00$cph_main_content$spuGasFinderResults$spuGasFinder$ddlState':'',
					'ctl00$cph_main_content$spuGasFinderResults$spuGasFinder$ddlCity':'',
					'__EVENTTARGET': event,
					'__EVENTARGUMENT':'',
					'__VIEWSTATE': viewstate,
					'__VIEWSTATE1': viewstate1,
					'__VIEWSTATEGENERATOR':'E5BD98B6',
					'__EVENTVALIDATION':validation,
					'__VIEWSTATEFIELDCOUNT':'2',
					'__VIEWSTATEENCRYPTED':'',
					'__ASYNCPOST':'true'}

		if page_num > 24:
			viewstate = ''
			viewstate1 = ''
			validation = ''

			script_man = 'ctl00$cph_main_content$spuGasFinderResults$upPaging|ctl00$cph_main_content$spuGasFinderResults$gvStores$ctl04$Page%s' %page_num
			event = 'ctl00$cph_main_content$spuGasFinderResults$gvStores$ctl04$Page%s' %page_num

			# Request post
			payload = {'ctl00$ScriptManager1': script_man,
						'ctl00$cph_main_content$spuGasFinderResults$spuGasFinder$txtZip':'',
						'ctl00$cph_main_content$spuGasFinderResults$spuGasFinder$ddlState':'',
						'ctl00$cph_main_content$spuGasFinderResults$spuGasFinder$ddlCity':'',
						'__EVENTTARGET': event,
						'__EVENTARGUMENT':'',
						'__VIEWSTATE': viewstate,
						'__VIEWSTATE1': viewstate1,
						'__VIEWSTATEGENERATOR':'E5BD98B6',
						'__EVENTVALIDATION':validation,
						'__VIEWSTATEENCRYPTED':'',
						'__ASYNCPOST':'true'}

		response = session.post(base_link,headers=HEADERS,data=payload)
		base = BeautifulSoup(response.text,"lxml")
		
		items = base.find(class_="icon_results").find_all("table")[:-1]
		# geos = re.findall(r'maps.LatLng\([0-9]{2}\.[0-9]+,-[0-9]{2,3}\.[0-9]+\)',str(base))

		for row in range(len(items)):
			item = items[row]
			# geo = geos[row]

			location_name = item.strong.text.strip()

			raw_address = list(item.stripped_strings)
			street_address = raw_address[1].strip()
			city = raw_address[2].split(",")[0].strip()
			state = raw_address[2].split(",")[1].strip()[:-6].strip()
			zip_code = raw_address[2].split(",")[1].strip()[-6:].strip().replace("51264","61264")

			phone = raw_address[-1].strip()
			country_code = "US"
			store_number = "<MISSING>"
			
			types = item.find("div").find_all("img")
			location_type = ""
			for raw_type in types:
				location_type = (location_type + ", " + raw_type["alt"])
			location_type = location_type[2:].strip().replace("\n","")
			location_type = (re.sub(' +', ' ', location_type)).strip()

			hours_of_operation = "<MISSING>"
			# latitude = geo.split("(")[1].split(",")[0]
			# longitude = geo.split("(")[1].split(",")[1].split(")")[0]
			latitude = "<MISSING>"
			longitude = "<MISSING>"

			data.append([locator_domain, "<MISSING>", location_name, street_address, city, state, zip_code, country_code, store_number, phone, location_type, latitude, longitude, hours_of_operation])

	return data

def scrape():
	data = fetch_data()
	write_output(data)

scrape()
